import styled from "styled-components/native";

export const theme = {
  color: {
    black: "#000",
    white: "#fff",
    button: "#FE7F5E",
    border: "#dadae8",
    inputBackground: "#F8F8F8",
  },
};

export const Container = styled.View`
  flex: 1;
  padding: 0 10px;
  background-color: #fff;
`;

export const AuthContainer = styled.View`
  flex: 1;
  padding: 0 10px;
  background-color: #f4f7fe;
`;
